INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 7, 1, 0, 0, "キャル", 1, 1, 0.0, 7001, 0.0, 106001, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 7, 1, 0, 0, "コッコロ", 1, 1, 0.0, 7002, 0.0, 105901, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 7, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 7003, 0.0, 105801, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 10, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 10001, 0.0, 105801, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 10, 1, 0, 0, "キャル", 1, 1, 0.0, 10002, 0.0, 106001, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 10, 1, 0, 0, "コッコロ", 1, 1, 0.0, 10003, 0.0, 105901, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 10, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 10004, 0.0, 106401, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 12, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 12001, 0.0, 105801, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 13, 1, 0, 0, "キャル", 1, 1, 0.0, 13001, 0.0, 106001, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 13, 1, 0, 0, "コッコロ", 1, 1, 0.0, 13002, 0.0, 105901, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 13, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 13003, 0.0, 106401, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 13, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 13004, 0.0, 105801, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 14, 1, 0, 0, "コッコロ", 1, 1, 0.0, 14001, 0.0, 105901, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 14, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 14002, 0.0, 106401, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 14, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 14003, 0.0, 105801, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 14, 1, 0, 0, "キャル", 1, 1, 0.0, 14004, 0.0, 106001, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, "2030/12/17 14:59:59", 15, 1, 0, 0, "コッコロ", 1, 1, 0.0, 15001, 0.0, 105901, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 16, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 16001, 0.0, 106401, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 16, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 16002, 0.0, 105801, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 16, 1, 0, 0, "キャル", 1, 1, 0.0, 16003, 0.0, 106001, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 16, 1, 0, 0, "コッコロ", 1, 1, 0.0, 16004, 0.0, 105901, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 17, 1, 0, 0, "コッコロ", 1, 1, 0.0, 17002, 0.0, 105901, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 25, 1, 0, 0, "キャル", 1, 1, 0.0, 17004, 0.0, 106001, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 25, 1, 0, 0, "コッコロ", 1, 1, 0.0, 17005, 0.0, 105901, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 25, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 17006, 0.0, 106401, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 25, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 17007, 0.0, 105801, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 18, 1, 0, 0, "カリン", 1, 1, 0.0, 18001, 0.0, 190801, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 18, 1, 0, 0, "カリン", 1, 2, 0.0, 18002, 0.0, 190801, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, "2030/12/17 14:59:59", 19, 1, 0, 0, "カリン", 1, 3, 0.0, 19001, 0.0, 190801, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, "2030/12/17 14:59:59", 19, 1, 0, 0, "カリン", 1, 4, 0.0, 19002, 0.0, 190801, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, "2030/12/17 14:59:59", 20, 1, 0, 0, "カリン", 1, 5, 0.0, 20001, 0.0, 190801, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-470.0, "2030/12/17 14:59:59", 20, 1, 0, 0, "カリン", 1, 6, 0.0, 20002, 0.0, 190801, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 21, 1, 0, 0, "キャル", 1, 1, 0.0, 21001, 0.0, 106001, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 21, 1, 0, 0, "コッコロ", 1, 1, 0.0, 21002, 0.0, 105901, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 21, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 21003, 0.0, 106401, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 21, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 21004, 0.0, 105801, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, "2030/12/17 14:59:59", 22, 1, 0, 0, "カリン", 1, 1, 0.0, 22001, 0.0, 190801, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, "2030/12/17 14:59:59", 22, 1, 0, 0, "カリン", 1, 2, 0.0, 22002, 0.0, 190801, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, "2030/12/17 14:59:59", 23, 1, 0, 0, "カリン", 1, 3, 0.0, 23001, 0.0, 190801, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, "2030/12/17 14:59:59", 23, 1, 0, 0, "カリン", 1, 4, 0.0, 23002, 0.0, 190801, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 2, 1, 4.08, 24001, 8.0, 109001, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 2, 2, 5.0, 24002, 8.0, 109001, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 2, 3, 10.11, 24003, 8.0, 109001, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 2, 4, 4.0, 24004, 8.0, 109001, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 2, 5, 6.0, 24005, 8.0, 109001, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 1, 6, 0.0, 24006, 0.0, 109002, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 1, 7, 0.0, 24007, 0.0, 109002, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 1, 8, 0.0, 24008, 0.0, 109002, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 1, 9, 0.0, 24009, 0.0, 109002, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "エリコ（バレンタイン）", 1, 10, 0.0, 24010, 0.0, 109002, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 2, 1, 2.12, 24011, 8.0, 109101, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 5, 0, 10011, "シズル（バレンタイン）", 2, 2, 4.19, 24012, 8.0, 109101, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 2, 0, 10011, "シズル（バレンタイン）", 4, 3, 2.3, 24013, 8.0, 109101, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 1, 4, 0.0, 24014, 0.0, 109102, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 5, 0, 10011, "シズル（バレンタイン）", 2, 5, 5.23, 24015, 8.0, 109101, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 1, 6, 0.0, 24016, 0.0, 109102, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-385.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 2, 7, 5.01, 24017, 8.0, 109101, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 1, 8, 0.0, 24018, 0.0, 109102, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 1, 9, 0.0, 24019, 0.0, 109102, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, "2030/12/17 14:59:59", 24, 1, 0, 10011, "シズル（バレンタイン）", 1, 10, 0.0, 24020, 0.0, 109102, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 26, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 26001, 0.0, 106401, "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 26, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 26002, 0.0, 105801, "2015/12/17 15:00:00", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 26, 1, 0, 0, "キャル", 1, 1, 0.0, 26003, 0.0, 106001, "2015/12/17 15:00:00", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 26, 1, 0, 0, "コッコロ", 1, 1, 0.0, 26004, 0.0, 105901, "2015/12/17 15:00:00", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 27, 2, 2104010, 0, "シェフィ", 1, 1, 0.0, 27001, 0.0, 106401, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 27, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 27002, 0.0, 105801, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 27, 1, 0, 0, "キャル", 1, 1, 0.0, 27003, 0.0, 106001, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 27, 1, 0, 0, "コッコロ", 1, 1, 0.0, 27004, 0.0, 105901, "2015/12/17 15:00:00", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 28, 1, 0, 0, "カリン", 1, 1, 0.0, 28001, 0.0, 190801, "2019/09/24 15:00:00", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 28, 1, 0, 0, "カリン", 1, 2, 0.0, 28002, 0.0, 190801, "2019/09/24 15:00:00", "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 29, 1, 0, 0, "カリン", 1, 3, 0.0, 29001, 0.0, 190801, "2019/09/24 15:00:00", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 29, 1, 0, 0, "カリン", 1, 4, 0.0, 29002, 0.0, 190801, "2019/09/24 15:00:00", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 30, 1, 0, 0, "カリン", 1, 5, 0.0, 30001, 0.0, 190801, "2019/09/24 15:00:00", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 30, 1, 0, 0, "カリン", 1, 6, 0.0, 30002, 0.0, 190801, "2019/09/24 15:00:00", "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 31, 1, 0, 0, "カリン", 1, 7, 0.0, 31001, 0.0, 190801, "2019/10/31 12:00:00", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2030/12/17 14:59:59", 31, 1, 0, 0, "カリン", 1, 8, 0.0, 31002, 0.0, 190801, "2019/10/31 12:00:00", "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/04 4:59:59", 32, 1, 0, 0, "カリン", 1, 1, 0.0, 32001, 0.0, 190801, "2019/12/20 5:00:00", "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/04 4:59:59", 32, 1, 0, 0, "カリン", 1, 2, 0.0, 32002, 0.0, 190801, "2019/12/20 5:00:00", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/04 4:59:59", 33, 1, 0, 0, "カリン", 1, 3, 0.0, 33001, 0.0, 190801, "2019/12/20 5:00:00", "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/04 4:59:59", 33, 1, 0, 0, "カリン", 1, 4, 0.0, 33002, 0.0, 190801, "2019/12/20 5:00:00", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/10 11:59:59", 34, 1, 0, 0, "カリン", 1, 5, 0.0, 34001, 0.0, 190801, "2020/01/04 5:00:00", "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-409.0, "2020/01/10 11:59:59", 34, 1, 0, 0, "カリン", 1, 6, 0.0, 34002, 0.0, 190801, "2020/01/04 5:00:00", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-458.0, "2030/12/17 14:59:59", 38, 1, 0, 0, "ペコリーヌ", 2, 1, 5.3, 38001, 0.0, 105801, "2015/12/17 15:00:00", "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-458.0, "2030/12/17 14:59:59", 38, 1, 0, 0, "ペコリーヌ", 2, 2, 6.5, 38002, 0.0, 105801, "2015/12/17 15:00:00", "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (9999.0, "2020/04/08 23:59:59", 39, 3, 0, 0, "ペコリーヌ", 3, 0, 0.0, 39005, 9999.0, 105801, "2020/04/01", "");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-430.0, "2030/12/17 14:59:59", 40, 1, 0, 0, "カリン", 1, 2, 0.0, 40001, 0.0, 190801, "2015/12/17 15:00:00", "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 41, 1, 2104010, 0, "シェフィ", 1, 1, 0.0, 41001, 0.0, 106401, "2015/12/17 15:00:00", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 41, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 41002, 0.0, 105801, "2015/12/17 15:00:00", "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 41, 1, 0, 0, "キャル", 1, 1, 0.0, 41003, 0.0, 106001, "2015/12/17 15:00:00", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 41, 1, 0, 0, "コッコロ", 1, 1, 0.0, 41004, 0.0, 105901, "2015/12/17 15:00:00", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 42, 1, 0, 0, "コッコロ", 1, 1, 0.0, 42001, 0.0, 105901, "2015/12/17 15:00:00", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 42, 1, 2104010, 0, "シェフィ", 1, 1, 0.0, 42002, 0.0, 106401, "2015/12/17 15:00:00", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 42, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 42003, 0.0, 105801, "2015/12/17 15:00:00", "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 42, 1, 0, 0, "キャル", 1, 1, 0.0, 42004, 0.0, 106001, "2015/12/17 15:00:00", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 43, 1, 0, 0, "ペコリーヌ", 1, 1, 0.0, 43001, 0.0, 105801, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 43, 1, 0, 0, "コッコロ", 1, 1, 0.0, 43002, 0.0, 105901, "2015/12/17 15:00:00", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-363.0, "2030/12/17 14:59:59", 43, 1, 0, 0, "キャル", 1, 1, 0.0, 43003, 0.0, 106001, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 44, 1, 0, 0, "アメス", 1, 1, 0.0, 43004, 0.0, 123001, "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 44, 1, 0, 0, "アメス", 1, 2, 0.0, 43005, 0.0, 123001, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (-416.5, "2030/12/17 14:59:59", 45, 1, 0, 0, "アメス", 2, 3, 5.79, 43006, 0.0, 123001, "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
